//The url of the audioFile
var url = '/media/asset/07b4b79b/286c/42d1/9f04/8cc92425d46b.mp3';
var autoplay = false;
var distance = 20;
var hoverscale = 1.4;

var ts = new THREE.Vector3(this.scale.x, this.scale.y, this.scale.z);
var os = new THREE.Vector3(this.scale.x*hoverscale, this.scale.y*hoverscale, this.scale.z*hoverscale);

//Don't change these
var audioSource;

function init ( event ){

	audioSource = new THREE.PositionalAudio(camera.getObjectByName('Listener'));
	audioSource.load( url );
	audioSource.setRefDistance( distance );
	audioSource.autoplay = autoplay;
	this.add( audioSource );
}

function rayHoverStart( event ){
	audioSource.play();
	TweenMax.to(this.scale, 0.35, {x:os.x,y:os.y,z:os.z});		
}

function rayEnd( event ){
	audioSource.stop();
	TweenMax.to(this.scale, 0.35, {x:ts.x,y:ts.y,z:ts.z});		
}

function rayStart(event){
	this.material.wireframe =!this.material.wireframe;
	scene.getObjectByName("Object1").visible = !scene.getObjectByName("Object1").visible;
}

