//Name of the Object you'd like to jump to.
var targetName = "Fader";
var targetPos;
var blocka = scene.getObjectByName ("Fader");
var hoverscale = 1.4;
var ts = new THREE.Vector3(this.scale.x, this.scale.y, this.scale.z);
var os = new THREE.Vector3(this.scale.x*hoverscale, this.scale.y*hoverscale, this.scale.z*hoverscale);

function init( event ){
	targetPos = scene.getObjectByName(targetName).position;
}

//Click/Touch Start
function rayStart( event ) {	
	camera.position.set(targetPos.x, targetPos.y, targetPos.z);
	TweenMax.to(blocka.material,2, {opacity:0, delay:0.3, ease: Circ.easeOut});
}


function rayHoverStart( event ){
	TweenMax.to(this.scale, 0.35, {x:os.x,y:os.y,z:os.z});		
}

function rayEnd( event ){
	TweenMax.to(this.scale, 0.35, {x:ts.x,y:ts.y,z:ts.z});		
}

function update( event ) {this.quaternion.copy (camera.quaternion);}

