////Change the following values
//////////
//Target hover size. Uniform scaling
var size = 1.8;


//The time it takes to reach this object
var moveTime = 1;

//If you'd like to move at a constant speed, set to true
//This helps when objects are far away and you don't want to get beamed there instantly
var constantSpeed = true;

//You move 0.5 units per second ( Only for constant speed travel )
var speed = 1;

//Those don't need to be change necessarily
//////////
//Safe initial object size to scale back at rayEnd.
var ts = new THREE.Vector3(this.scale.x, this.scale.y, this.scale.z);
var os = new THREE.Vector3(ts.x * size, ts.y * size, ts.z*size);

//Mouse/Touch Start
function rayStart( event ){

	if(constantSpeed){

		var distance = camera.position.distanceTo(this.position);
		//console.log(distance);
		moveTime = distance * speed;

	}

	TweenMax.to(camera.position, moveTime, {x: this.position.x, y:this.position.y, z:this.position.z});	

	//this.visible = false;

}

//First Gaze/Mouse Over
function rayHoverStart( event ) {
	//player.crossHairScaling(true);
	TweenMax.to(this.scale, 1, {x: os.x, y:os.y, z:os.z});	
}

//Gaze/Mouse/Touch End
function rayEnd( event ) {
	//player.crossHairScaling(false);
	TweenMax.to(this.scale, 1, {x: ts.x, y:ts.y, z:ts.z});
}

function update(event) {
	this.quaternion.copy (camera.quaternion);
}
